CREATE OR REPLACE FUNCTION student_circle_update_trigger_function()
    RETURNS TRIGGER AS
$$
DECLARE
    v_pd_done               BOOLEAN;
    v_tr_done               BOOLEAN;
    v_course_id             INT;
    v_request_create_course JSONB;
    class_session           JSONB;
    v_student_id            INT;
    v_duration              INT;
BEGIN

    SELECT duration INTO v_duration FROM syllabus WHERE syllabus_id = NEW.syllabus_id;

    SELECT is_pd_done, is_tr_done, course_id, request_create_course::JSONB, student_id
    INTO v_pd_done, v_tr_done, v_course_id, v_request_create_course, v_student_id
    FROM student_circle
    WHERE student_circle_id = NEW.student_circle_id;

    IF v_pd_done IS TRUE AND v_tr_done IS TRUE THEN
        IF v_course_id IS NOT NULL THEN
            UPDATE student_circle
            SET course_id = NULL
            WHERE student_circle_id = NEW.student_circle_id;

            DELETE
            FROM course
            WHERE course_id = v_course_id;

            DELETE
            FROM class_session
            WHERE course_id = v_course_id;
        END IF;

        INSERT INTO course (program_id, level_program, status_course, student_id, start_date, teacher_id)
        VALUES ((v_request_create_course ->> 'program_id')::INT,
                v_request_create_course ->> 'level_program',
                v_request_create_course ->> 'status_course',
                (v_request_create_course ->> 'student_id')::INT,
                (v_request_create_course ->> 'start_date')::DATE,
                (v_request_create_course ->> 'teacher_id')::INT)
        RETURNING course_id INTO v_course_id;

        FOR class_session IN SELECT * FROM jsonb_array_elements(v_request_create_course -> 'class_sessions')
            LOOP
                INSERT INTO class_session (course_id, going_date_time, teacher_id, student_id, duration, session_status)
                VALUES (v_course_id,
                        (class_session ->> 'going_date_time')::TIMESTAMP,
                        (class_session ->> 'teacher_id')::INT,
                        v_student_id,
                        v_duration,
                        'upcoming');
            END LOOP;

        UPDATE student_circle
        SET course_id = v_course_id
        WHERE student_circle_id = NEW.student_circle_id;

    END IF;

    RETURN NEW;

END;
$$ LANGUAGE plpgsql;

CREATE TRIGGER after_student_circle_update
    AFTER UPDATE OF is_pd_done, is_tr_done
    ON student_circle
    FOR EACH ROW
    WHEN (OLD.is_pd_done IS DISTINCT FROM NEW.is_pd_done OR
          OLD.is_tr_done IS DISTINCT FROM NEW.is_tr_done)
EXECUTE FUNCTION student_circle_update_trigger_function();

