CREATE OR REPLACE FUNCTION public.update_student_circle_data(p_student_circle_id integer, p_request_create_classin jsonb)
 RETURNS void
 LANGUAGE plpgsql
AS $function$
DECLARE
    session_data JSONB; -- T·ª´ng ph·∫ßn t·ª≠ trong class_sessions
    v_going_date_time TIMESTAMP; -- Bi·∫øn l∆∞u going_date_time
    v_teacher_id INT; -- Bi·∫øn l∆∞u teacher_id
    v_account_classin_id INT; -- Bi·∫øn l∆∞u account_classin_id
    parsed_request JSONB; -- D·ªØ li·ªáu JSONB th·ª±c sau khi gi·∫£i m√£
BEGIN
    -- Ki·ªÉm tra n·∫øu p_request_create_classin kh√¥ng t·ªìn t·∫°i
    IF p_request_create_classin IS NULL THEN
        RAISE NOTICE 'No request_create_classin provided for student_circle_id: %', p_student_circle_id;
        RETURN;
    END IF;

    -- Gi·∫£i m√£ JSON chu·ªói th√†nh JSONB
    parsed_request := p_request_create_classin;

    -- L·∫•y teacher_id t·ª´ parsed_request
    v_teacher_id := (parsed_request->>'teacher_id')::INT;

    -- Ki·ªÉm tra n·∫øu kh√¥ng l·∫•y ƒë∆∞·ª£c teacher_id
    IF v_teacher_id IS NULL THEN
        RAISE NOTICE 'No teacher_id found in request_create_course for student_circle_id: %', p_student_circle_id;
        RETURN;
    END IF;

    -- L·∫∑p qua t·ª´ng ph·∫ßn t·ª≠ trong class_sessions
    FOR session_data IN SELECT * FROM jsonb_array_elements(parsed_request->'class_sessions')
    LOOP
        -- Tr√≠ch xu·∫•t th√¥ng tin c·∫ßn thi·∫øt
        v_going_date_time := (session_data->>'going_date_time')::TIMESTAMP;

        -- ∆Øu ti√™n account_classin_id t·ª´ JSONB n·∫øu c√≥, n·∫øu kh√¥ng tra c·ª©u t·ª´ b·∫£ng
        v_account_classin_id := COALESCE(
            (session_data->>'account_classin_id')::INT, -- Gi√° tr·ªã t·ª´ JSONB
            (SELECT cs.account_classin_id               -- Tra c·ª©u t·ª´ b·∫£ng
             FROM class_session cs
             WHERE cs.going_date_time = v_going_date_time
               AND cs.teacher_id = v_teacher_id)
        );

        -- C·∫≠p nh·∫≠t b·∫£ng class_session v·ªõi account_classin_id n·∫øu ƒëi·ªÅu ki·ªán kh·ªõp
        IF v_account_classin_id IS NOT NULL THEN
            UPDATE class_session
            SET account_classin_id = v_account_classin_id
            WHERE class_session.going_date_time = v_going_date_time
              AND class_session.teacher_id = v_teacher_id;
        END IF;
    END LOOP;

    -- C·∫≠p nh·∫≠t is_qc_done th√†nh TRUE trong b·∫£ng student_circle
    UPDATE student_circle
    SET is_qc_done = TRUE
    WHERE student_circle_id = p_student_circle_id;

    -- Log th√¥ng b√°o k·∫øt qu·∫£
    RAISE NOTICE 'Processed class_sessions and updated is_qc_done for student_circle_id: %', p_student_circle_id;
END;
$function$

