create function update_syllabus_outline(p_syllabus_id integer, p_json_data text) returns text
    language plpgsql
as
$$
DECLARE
    record_data JSONB;
    json_data   JSONB := p_json_data::JSONB;
BEGIN

    DELETE
    FROM syllabus_outline
    WHERE syllabus_id = p_syllabus_id;

    FOR record_data IN SELECT * FROM jsonb_array_elements(json_data)
        LOOP
            INSERT INTO syllabus_outline (syllabus_id,
                                          ordialnum,
                                          topic_name,
                                          content,
                                          note)
            VALUES (p_syllabus_id,
                    (record_data ->> 'ordialnum')::INT,
                    (record_data ->> 'topic_name')::TEXT,
                    (record_data ->> 'content')::TEXT,
                    (record_data ->> 'note')::TEXT
                    )
        END LOOP;

    RETURN 'success';
END;
$$;

alter function update_syllabus_outline(integer, text) owner to postgres;

